import React from "react"
import RegistrationForm from "../forms/RegistrationForm"
import LoginForm from "../forms/LoginForm"

const HomePage = () => {
  return (
    <div className="ui container center aligned">
      <h1>Home Page</h1>
      <RegistrationForm />
      <LoginForm />
    </div>
  )
}

export default HomePage
